import React from "react";
import "./ChatRoom.css";
import human4 from "../../../Image/human4.jpg"

class ChatRoom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <div className="chatroom">
      <div className="row">
        <div className="col">
          <div className="row">
            <div className="col-lg nav-room">
              <img src={human4} alt="" width="60" height="60"/>
            </div>
          </div>
        </div>
      </div>
    </div>;
  }
}

export default ChatRoom;
